import Overlay from "./Overlay";
import '../stylesheets/Center.css';
import React from "react";

const ConfirmOverlay = ({text}) => {
    return (
        <Overlay content={
            <div className="center confirmOverlay" style={{backgroundColor: "white"}}>
                <h3>{text}</h3>
                <div>
                    <button>Ja</button>
                    <button>Nei</button>
                </div>
            </div>
        }/>
    )
}

export default ConfirmOverlay;
